CREATE DEFINER=`seeder`@`%` PROCEDURE `shoppingExpences_hh_from_to`(in _household_name varchar(255), in _from varchar(10), in _to varchar(10))
begin select _household_name as "Nazwa", sum(shopping_items.quantity*shopping_items.price-shopping_items.quantity*shopping_items.discount_on_unit) as "Koszt całkowity" from shopping_items join households on households.id = shopping_items.household_id where households.name = _household_name and shopping_items.date between _from and _to; end ;;
